import React, { Component } from 'react';



class Todoitem extends Component {
  render(){
    return(
        <div>
       <p>{this.props.todoit.id}</p>
       <p>{this.props.todoit.title}</p>
       <p>{this.props.todoit.desc}</p>
       </div>
      

    );
  }
}

export default Todoitem;
